.nav {
  position: fixed;
  width: 100%;
  left: 0;
  top: 0;
  z-index: 100;
  @include flex(flex-end);
  padding: 6px 0px 6px 15px;
  background-color: $main-color;

  &__hamburger {
    width: 70px;
    height: 45px;
    cursor: pointer;
    border: none;
    border-radius: 0 0 0 30px;
    position: relative;

    &__item {
      display: block;
      width: 35px;
      height: 5.3px;
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      background-color: $primary-black;
      border-radius: 50px;
      transition: 0.3s;

      &:nth-child(1) {
        transform: translate(-50%, -50%) translateY(-12px);
        transition: 0.3s;
      }

      &:nth-child(4) {
        transform: translate(-50%, -50%) translateY(12px);
        transition: 0.3s;
      }
    }

    &--active {
      span:nth-child(1) {
        transform: translate(-50%, -50%) translateY(-33px);
        opacity: 0;
      }

      span:nth-child(4) {
        transform: translate(-50%, -50%) translateY(33px);
        opacity: 0;
      }

      span:nth-child(2) {
        transform: translate(-50%, -50%) rotate(45deg);
        transition-delay: 0.2s;
      }

      span:nth-child(3) {
        transform: translate(-50%, -50%) rotate(-45deg);
        transition-delay: 0.2s;
      }
    }
  }
}

.menu {
  position: fixed;
  top: 0;
  left: 0;
  transform: translateX(-1000px);
  width: 100vw;
  height: 100vh;
  z-index: -1;
  background-color: $primary-white;
  transition: transform 0.5s;

  &--active {
    transform: translateX(0);
    transition: transform 0.5s;
  }

  &__links {
    height: 100%;
    @include flex;
    flex-flow: column wrap;
    margin: 0;
    padding: 0;
    list-style-type: none;

    &__link {
      font-size: 1.5rem;
      font-weight: bold;
      text-transform: uppercase;
      line-height: 2.3rem;
      position: relative;

      &::after {
        @include pseudo;
        transform-origin: 0% 0%;
        transform: scaleX(0);
        transition: transform 0.3s;
        border-bottom: 2.5px solid $primary-black;
      }

      &:hover::after {
        transform: scaleX(1);
        transition: transform 0.3s;
      }
    }
  }
}

@media all and (min-width: 720px) {
  .menu__links__link {
    font-size: 1.8rem;
