    margin: 40px 0 30px 0;
    justify-items: center;
    justify-content: center;
    max-width: 100%;

    .project {
      width: 75vw;
      max-width: 310px;
      height: 75vw;
      max-height: 310px;
      margin: 30px;
      position: relative;
      cursor: pointer;

      &::after,
      &::before {
        @include pseudo(100%, 0, 0, transparent, -5);
        transition: all 0.4s;
      }

